import './App.css';
import Navbars from './components/Navbars'
import { Image } from 'react-bootstrap';
import { Route, Switch } from "react-router";
import Project from './components/Project';
import Resume from './components/Resume';
import About from './components/About';
function App()
{
  return (
    <div className="App">
      <BrowserRouter>
      <Switch>
    <Route exact path="/projects">
      <Project />
    </Route>
    <Route path="/about">
          <About/>
    </Route>
    <Route path="/resume">
      <Resume />
    </Route>
        </Switch>
        </BrowserRouter>
      <Navbars/>
        <Image src="/human.png" alt="woman on chair" width="600px" height="500px" />
    </div>
  );
}

export default App;
